export const DISH_ACTIONS = {
  loadDishes: "dish/loadDishs",
  startLoading: "dish/startLoading",
  successLoading: "dish/successLoading",
  failLoading: "dish/failLoading",
};

export const loadDishes = (restaurantId) => ({
  type: DISH_ACTIONS.loadDishes,
  payload: restaurantId,
});

export const successLoading = (normalizedDish) => ({
  type: DISH_ACTIONS.successLoading,
  payload: normalizedDish,
});

export const failLoading = () => ({
  type: DISH_ACTIONS.failLoading,
});

export const startLoading = () => ({
  type: DISH_ACTIONS.startLoading,
});
